import { useEffect, useState} from 'react'
import Table from './components/Table'
import getApi from './services/getDespesas'




function App() {

  const [despesas, setDespesas] = useState([])

  useEffect(() => {
    getApi()
    .then((despesas) => {
      setDespesas(despesas)
    })
  }, [])

  return (
    <div>
     <Table />
    </div>
  );
}

export default App;
